import React from 'react';
import './Commitees.css';

const Commitees = () => {
    return (
        <div className="container">
            <div className="division">
                <img src=".assets/p1.jpg" alt="Your Image" />
            </div>
            <div className="division">
                <p>Your text goes here</p>
            </div>
        </div>
    );
};

export default Commitees;
